import React from 'react'
import './App.css';
import Post from './Post';

function App() {
  return (
    <div className="app">
      <div className="app__header">
        <img className="app__headerImage " src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png" alt=""/>
      </div>
    {/* Header */}

     <h1>Let build instagram clone in react</h1>
      <Post username="Asif Shaikh" caption="Looking Good Vibes" imageUrl="https://scontent-bom1-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/127112680_1132050023913708_9132443160948186728_n.jpg?_nc_ht=scontent-bom1-2.cdninstagram.com&_nc_cat=100&_nc_ohc=WfMS2HHdQ6sAX-K9vD_&tp=1&oh=78d9c6b5a9d374ab9bfa36470f99688f&oe=5FE4BE52" />
      <Post username="Arif Shaikh" caption="Handsome Boy" imageUrl="https://scontent-bom1-2.cdninstagram.com/v/t51.2885-15/e35/126855265_197138488551364_8762708905028159970_n.jpg?_nc_ht=scontent-bom1-2.cdninstagram.com&_nc_cat=1&_nc_ohc=FbIJ1OhJ98QAX_d43Qy&tp=1&oh=d4ffe6e72b240d4ced4391be69c1a4d4&oe=5FE5C42D" />
      <Post username="Abdul Shaikh" caption="Have fun!" imageUrl="https://scontent-bom1-2.cdninstagram.com/v/t51.2885-15/e35/126814483_367727654521891_3169890284674577031_n.jpg?_nc_ht=scontent-bom1-2.cdninstagram.com&_nc_cat=1&_nc_ohc=XFvyeMmfGckAX-xMuWo&tp=1&oh=9fd0a53661af0e05184c230a20c90de2&oe=5FE5A311" />
      <Post username="Nusrat Shaikh" caption="Fun day have sunday!" imageUrl="https://scontent-bom1-2.cdninstagram.com/v/t51.2885-15/e35/127390739_375471417059778_6644043487782251960_n.jpg?_nc_ht=scontent-bom1-2.cdninstagram.com&_nc_cat=1&_nc_ohc=Hc9idDAZSFQAX9mXLBn&tp=1&oh=69be646a16bfdc4ba6e1c6a0cf4c2f54&oe=5FE577F8" />
      {/* Post */}
      {/* Post */}
    </div>
  );
}

export default App;
